SELECT DISTINCT ?Seed WHERE{
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Magazine> . 
	{?Seed	<http://dbpedia.org/ontology/country>	<http://dbpedia.org/resource/Japan>.} UNION 
	{?Seed	<http://dbpedia.org/ontology/language>	<http://dbpedia.org/resource/Japanese_language>.} UNION 
	{?Seed	<http://dbpedia.org/ontology/publisher>	<http://dbpedia.org/resource/Takarajimasha>.} 
}

SELECT (COUNT (?Seed) AS ?count) WHERE{
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Village> . 
	MINUS{ 
		{?Seed	<http://dbpedia.org/ontology/principalArea>	<http://dbpedia.org/resource/Anglesey>.} UNION 
		{?Seed	<http://dbpedia.org/ontology/country>	<http://dbpedia.org/resource/United_Kingdom>.} 
	} 
}

SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Scientist> .
	?Seed	<http://dbpedia.org/ontology/academicAdvisor>	?count. 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) >= 6)

SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Grape> .
	?Seed	<http://dbpedia.org/ontology/wineRegion>	?count. 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) <= 6)

SELECT (COUNT (?Seed) AS ?count) WHERE{
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Scientist> . 
	{?Seed	<http://dbpedia.org/ontology/academicAdvisor>	<http://dbpedia.org/resource/Leonard_Johnston_Wills>.} UNION 
